  Klein 3000 sidescan-sonar survey lines collected in Moultonborough Bay, Lake Winnipesaukee,
  New Hampshire by the U.S. Geological Survey in 2005 (Geographic, WGS 84, Esri Polyline
  Shapefile).\",\n\t\"tracking_summary\": {\n\t\t\"total\": 20,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
