  \"2005-004-fa-sonartrk-klein-3000-sidescan-sonar-survey-lines-collected-in-moultonborough-bay-lak\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"In freshwater bodies of New Hampshire,
  the most problematic aquatic invasive plant species is Myriophyllum heterophyllum
  or variable leaf water-milfoil. Once established, variable leaf water-milfoil forms
  dense beds that can alter the limnologic characteristics of a waterbody, impacting
  natural lacustrine communities and their habitats. Variable leaf water-milfoil infestations
  also disrupt recreational uses of waterbodies and have negatively affected swimming,
  boating, fishing, and property values in and around several lakes and ponds in New
  Hampshire. In 1965, Moultonborough Bay, Lake Winnipesaukee became the first waterbody
  in New Hampshire where variable leaf water-milfoil was observed. Variable leaf water-milfoil
  is native to the Southeastern and Midwestern areas of the United States where more
  alkaline waters appear to limit the growth of this plant. Outside its native range,
  however, it adapts well to the relatively acidic, low-alkalinity, and nutrient-poor
  conditions of oligotrophic lakes and bays similar to Moultonborough Bay. In 2005,
  the New Hampshire Department of Environmental Services (NHDES) collaborated with
  the U.S. Geological Survey to investigate the distribution (presence and density)
  of variable leaf water-milfoil in Moultonborough Bay. This study utilized geophysical
  systems and conventional water-quality measurements to identify lake-floor environments
  that may provide suitable habitat for the establishment and growth of variable leaf
  water-milfoil. The results of the study are intended to assist resource managers
  in federal and state agencies by providing methods for detecting variable leaf water-milfoil
  and for identifying areas susceptible to infestation. Ultimately, this information
